import './OpenStreetMapMap.css';
import PropTypes from 'prop-types';

export default function OpenStreetMapMap({ latitude, longitude, scale }) {
    if (typeof latitude === 'undefined' || typeof longitude === 'undefined') {
        return;
    }

    let fixedScale = scale;
    if (typeof scale === 'undefined') {
        fixedScale = 0.005;
    }

    mapLink = src= 'https://maps.google.com/maps?q=' + displayed.latitude + ',' + displayed.longitude + '&t=&z=13&ie=UTF8&iwloc=&output=embed';

    return(
    <div className="googlemaps-container">
        <iframe className='googlemaps' title='info' src={mapLink}></iframe>
    </div>
    )
}

OpenStreetMapMap.propTypes = {
    latitude: PropTypes.number,
    longitude: PropTypes.number,
    scale: PropTypes.number
}
